 whitelists users with txAdmin permissions, which is sufficient for most servers. You can manage this behavior through the Whitelist Tx option in the settings panel.2. Whitelisting through the ElectronAC Web PanelBy adding a user as an admin in the ElectronAC web panel and including their Discord ID, they will be automatically whitelisted.3. Using ACE Permissions for WhitelistingFor more granular control, you can use ACE permissions:    Whitelisting a Group:To whitelist an entire group, add the following line to your server configuration:add_ace group.[group_name] Bypass allowReplace [group_name] with the appropriate group identifier, such as mod or admin.    Whitelisting an Individual Player:To whitelist a specific player, use their Discord identifier:add_ace identifier.discord:[discord_id] Bypass allowReplace [discord_id] with the players Discord ID.', NULL, 5, 0, 'https://www.youtube.com/watch?v=4o1YwBnLOpg', NULL, 'https://docs.electron-services.com/', NULL, false, 0);
